script: |
  super -f text -I q6531.spq | sort > q6531.out

inputs:
  - name: q6531.spq
    data: |
      SELECT DISTINCT COUNT ( DISTINCT col0 ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 85 / col0 BETWEEN ( 92 * - col0 ) AND - 55;
  - name: tab2

outputs:
  - name: q6531.out
    data: |
      3
